identification:
  title: INVESTIGATION OF DYNAMIC BEHAVIOUR OF SOIL DAMS TAKING INTO ACCOUNT INELASTIC
    PROPERTIES OF SOILS
  abstract: One of the actual problems in the science of mechanics is the estimation
    of the stress-strain state and dynamic behaviour of various structures with complex
    geometry and heterogeneous structural features. This, in turn, requires the development
    and use of mathematical models and computational methods to estimate the dynamic
    state and strength parameters of structures, taking into account their structural
    features and real material properties.
